window.bookSummaryJSON = "<p>As humanity is taking its final breath, facing extinction from a myriad of monsters, the last three people on earth are creating a final chance for the hero to go back in time and stop the apocalypse. However, before the hero can enter the chronomancer portal to the past, she and the portal's creator are both killed, leaving only the weak assistant to carry on their dream of saving the world. Will Nick be able to right the wrongs done to him, and prepare the hero for the world to come?</p> <p><b>When time weighs heavily, it's time to hit the weights in this regression LitRPG/Gamelit story of dungeon-diving, leveling stats, and facing down the apocalypse!</b></p>"; 
